import React from "react";

const MoviesItems = ({ movie, onMovieSelect }) => {
  return (
    <div onClick={() => onMovieSelect(movie)} className="item">
      <img className="ui tiny image" src={movie.Poster} alt={movie.Title} />
      <div className="content">
        <div className="header">{movie.Title}</div>
        <div className="description">
          <p>
            Veronika Ossi is a set designer living in New York who <a>enjoys</a>{" "}
            kittens, music, and partying.
          </p>
        </div>
      </div>
    </div>
  );
};

export default MoviesItems;
